export const data = {
    labels: ["January", "February", "March", "April", "May", "June"],
    datasets: [
      {
        label: 'Ritik',
        data: [2, 4, 5, 6, 1, 9],
        fill: true,
      },
      {
        label: 'Nikhil',
        data: [8, 3, 1, 6, 2, 9],
        fill: true,
      }
    ]
  };
